(1, 'activate_subscription', 'New Subscription Activated', '\"<p>Hello <strong>{first_name} {last_name}<\\/strong>,<br \\/><br \\/>Dear user, We are glad that you\'ve chosen our services for synthesizing your text, And with all due respect, we\'ve received your payment of<strong> {amount}<\\/strong> as well as your receipt of transaction number <strong>{transaction_id}<\\/strong>, which we\'ve approved if you had not received that mail&nbsp; please check the junk\\/spam section of your mail. <br \\/><br \\/>We\'re sending you this mail, to let you know that your subscription has been activated. <br \\/><br \\/>Your subscription will start from <strong>{start_date}<\\/strong> and will last for <strong>{month}<\\/strong> months which is on <strong>{expiry_date}<\\/strong>. <br \\/><br \\/>Thank you. <br \\/>With regards,<strong> {company_title}<\\/strong>.<\\/p>\"', 1, '2023-04-04 07:06:47', NULL);
