(17, 'about_us', '{\"about_us\":\"<h3><strong>eSpeech - All in One Text to Speech Platform<\\/strong><\\/h3>\\r\\n<p>Create an AI platform for your business where you and your customers can generate human-like voices from over 300+ Voices and 80+ languages. eSpeech solves the problem of managing your text to speech synthesis from multiple providers like Microsoft Cognitive Services, Google Cloud Platform, Amazon Polly, and IBM Watson. It provides the platform where you can synthesize the text of any language from all the given providers without needing to worry about the hectic integration process. You just focus on your business model and it will take care of all the other technical aspects of the system.<\\/p>\\r\\n<h3><strong>Service Providers like<\\/strong><\\/h3>\\r\\n<p>We have Text to Speech Services from world-class Text to Speech service providers like Google Cloud Platform, Amazon AWS Polly, Microsoft Azure &amp; IBM Watson.<\\/p>\\r\\n<h3><strong>Why go with eSpeech?<\\/strong><\\/h3>\\r\\n<ul>\\r\\n<li>Voice Generation using AI - To generate realistic voiceovers for videos, podcasts, learning tutorials, media entertainment, narrations, and much more, using powerful online AI voice synthesis APIs.<\\/li>\\r\\n<li>Made for - YouTubers, Video Artists, Story Telling Artists, Bloggers, Interactive Voice Response ( IVR ) systems, Advertisers, or Digital Content writers.<\\/li>\\r\\n<li>Audio Blog Posts - To convert your blog articles to audio using text to speech voices to increase content accessibility, user engagement, and time on page metrics.<\\/li>\\r\\n<li>Text to Speech API - Create your own API to sell and share it with other users across the globe and let them integrate the APIs to their desired platforms.<\\/li>\\r\\n<li>Commercial &amp; broadcast rights - You are free to use the generated speech files for commercial and personal use with full rights.<\\/li>\\r\\n<\\/ul>\\r\\n<h3><strong>Features you would love to explore<\\/strong><\\/h3>\\r\\n<ul>\\r\\n<li>SaaS-enabled Marketplace - eSpeech offers great SaaS ( Software as a Service ) module to satisfy your B2B, B2C or C2C business models and helps you to generate more revenue hassle freely.<\\/li>\\r\\n<li>Text-to-Speech - Collaborative standard and neural TTS services from different providers like Google, AWS, Azure and IBM in one single single place. Save TTS for later purpose and Download it anytime in mp3 format.<\\/li>\\r\\n<li>Voice Inflections - Fine-tune Rate, adjust Pitch, Emphasis, Pauses and do lot more with your voices to make it more realistic to create a more suitable voice tone.<\\/li>\\r\\n<li>Speech Styles - Use expressive emotional speaking styles to make the voices sound more natural and engaging.<\\/li>\\r\\n<li>SSML Support - Includes almost all Speech synthesis tags as they are supported by the TTS service providers.<\\/li>\\r\\n<li>Demo Voices - Create and manage demo voices easily where your customers won\'t have to spend their own characters to listen to the sample voices.<\\/li>\\r\\n<li>Dashboard - Rich Admin \\/ User Dashboard to give a complete insights of the system and its overall usage with no much efforts required.<\\/li>\\r\\n<li>Customizable system - Fully customizability options to customize front-end pages and theming, SMTP Settings, Text-to-Speech configs, Contact information and lot more let you create a white-label portal with ease.<\\/li>\\r\\n<li>Plans and Subscriptions<strong> <\\/strong>- Create and manage flexible plans where you can offer the same plan or many plans with variety of options. Super admin can also create and manage the subscriptions for customers from backend with ease.<\\/li>\\r\\n<li>flexibility of Plans Usage - Allows your customers to extend or activate upcoming plans with the ongoing plans without needing them to worrying about loosing their character balances.<\\/li>\\r\\n<li>Payment methods<strong> <\\/strong>- Wide range of payment methods like Stripe, Razorpay and Paystack<\\/li>\\r\\n<li>Transactions - Keeps track of all the transactions of your customers and cash flow in the system by your. Easily find filter records and generate reports for the future references.<\\/li>\\r\\n<li>Users - Strong Users or customers management with secure authentication system which supports managing customer profile at ease.<\\/li>\\r\\n<li>One Click update<strong> <\\/strong>- Automatic System Updater for all your future updates received from our end, where you do not need to make any single change in the code to update your code.<\\/li>\\r\\n<li>Modern Front end Website<strong> <\\/strong>- Elegant Looking front end with modern design to attract your customers and to give wider insight into the overall system with fractional efforts.<\\/li>\\r\\n<\\/ul>\\r\\n<div class=\\\"row mt-5\\\">\\r\\n<div class=\\\"col-10\\\">\\r\\n<h3><strong>What are you waiting for? Become a member of eSpeech Today<\\/strong><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-2 text-end\\\"><a class=\\\"view-more-plans \\\" href=\\\"..\\/..\\/auth\\\"> Join Now <\\/a><\\/div>\\r\\n<\\/div>\"}'),
